import { Route, Switch ,Router, Link} from 'react-router-dom';
import LoginForm from './Containers/LoginForm/LoginForm';


class App extends Component {
  render() {
    return (
      <div>
          {/* <Switch>

            <Route path="/" name="Home" exact component={Main} />
            <Route path="/" name="NewAd" component={NewAd} />
          </Switch>
          */}
          <LoginForm />
          <Main />
          <FullAd id='tria'/>

    </div>
    );
  }
}

export default App;
